import React from 'react';

function NavBar({ progress, speed }) {
  return (
    <div className="navbar">
      <div className="progress-bar">
        <div className="progress" style={{ width: `${progress}%` }}></div>
      </div>
      <div className="speed-display">
        Vitesse : {speed} Mbps
      </div>
    </div>
  );
}

export default NavBar;
